interface DialogProps {
    title: string;
    onClose: () => void;
    onSave: () => void;
    defaultValue?: string;
    isOpen: boolean;
}

const Dialog = (props: DialogProps): JSX.Element => {
    const { title, onClose, onSave, defaultValue, isOpen } = props;
    return (
        <dialog aria-modal={true}>
            <input type="text"/>
        </dialog>
    );
}

export default Dialog;
